//字符串转ArrayBuffer
let stringToBuffer = function (s) {
    let buf = new ArrayBuffer(s.length);
    let view = new Uint8Array(buf);
    for (let i=0; i < s.length; ++i) view[i] = s.charCodeAt(i) & 0xFF;
    return buf;
}

// 将一个sheet转成最终的excel文件的blob对象
let sheet2blob = function (sheet, fileType, sheetName) {
    sheetName = sheetName || 'sheet1';
    let workbook = {
        SheetNames: [sheetName],
        Sheets: {}
    };
    workbook.Sheets[sheetName] = sheet;
    // 生成excel的配置项
    let wopts = {
        bookType: fileType, // 要生成的文件类型, 支持 xlsx, csv, xml, txt
        bookSST: false, // 是否生成Shared String Table，如果开启生成速度会下降，但在低版本IOS设备上有更好的兼容性
        type: 'binary'
    };
    let wbout = external_XLSX_default.a.write(workbook, wopts);
    let blob = new Blob([stringToBuffer(wbout)], {type:"application/octet-stream,charset=UTF-8"});

    return blob;
}


